import React, { useEffect } from 'react';
import { listsongs } from '../json/songs';

function SongList() {
    
    const {songs} = listsongs;
    console.log(songs)
    return (
        <div>
            <h3>Song List</h3>
            {songs.map((song)=>{
                <p>{songs.title}</p>
            })}
        </div>
    )
}

export default SongList;
